---
AbortLocation:
  ENUM:
    0:
      Module:
        NEWTYPE:
          TYPENAME: ModuleId
    1:
      Script: UNIT
AccountAddress:
  NEWTYPESTRUCT:
    TUPLEARRAY:
      CONTENT: U8
      SIZE: 32
Argument:
  ENUM:
    0:
      GasCoin: UNIT
    1:
      Input:
        NEWTYPE: U16
    2:
      Result:
        NEWTYPE: U16
    3:
      NestedResult:
        TUPLE:
          - U16
          - U16
AuthorityPublicKeyBytes:
  NEWTYPESTRUCT: BYTES
CallArg:
  ENUM:
    0:
      Pure:
        NEWTYPE:
          SEQ: U8
    1:
      Object:
        NEWTYPE:
          TYPENAME: ObjectArg
ChangeEpoch:
  STRUCT:
    - epoch: U64
    - protocol_version:
        TYPENAME: ProtocolVersion
    - storage_charge: U64
    - computation_charge: U64
    - storage_rebate: U64
    - non_refundable_storage_fee: U64
    - epoch_start_timestamp_ms: U64
    - system_packages:
        SEQ:
          TUPLE:
            - TYPENAME: SequenceNumber
            - SEQ:
                SEQ: U8
            - SEQ:
                TYPENAME: ObjectID
CheckpointCommitment:
  ENUM:
    0:
      ECMHLiveObjectSetDigest:
        NEWTYPE:
          TYPENAME: ECMHLiveObjectSetDigest
CheckpointContents:
  ENUM:
    0:
      V1:
        NEWTYPE:
          TYPENAME: CheckpointContentsV1
CheckpointContentsDigest:
  NEWTYPESTRUCT:
    TYPENAME: Digest
CheckpointContentsV1:
  STRUCT:
    - transactions:
        SEQ:
          TYPENAME: ExecutionDigests
    - user_signatures:
        SEQ:
          SEQ:
            TYPENAME: GenericSignature
CheckpointDigest:
  NEWTYPESTRUCT:
    TYPENAME: Digest
CheckpointSummary:
  STRUCT:
    - epoch: U64
    - sequence_number: U64
    - network_total_transactions: U64
    - content_digest:
        TYPENAME: CheckpointContentsDigest
    - previous_digest:
        OPTION:
          TYPENAME: CheckpointDigest
    - epoch_rolling_gas_cost_summary:
        TYPENAME: GasCostSummary
    - timestamp_ms: U64
    - checkpoint_commitments:
        SEQ:
          TYPENAME: CheckpointCommitment
    - end_of_epoch_data:
        OPTION:
          TYPENAME: EndOfEpochData
    - version_specific_data:
        SEQ: U8
Command:
  ENUM:
    0:
      MoveCall:
        NEWTYPE:
          TYPENAME: ProgrammableMoveCall
    1:
      TransferObjects:
        TUPLE:
          - SEQ:
              TYPENAME: Argument
          - TYPENAME: Argument
    2:
      SplitCoins:
        TUPLE:
          - TYPENAME: Argument
          - SEQ:
              TYPENAME: Argument
    3:
      MergeCoins:
        TUPLE:
          - TYPENAME: Argument
          - SEQ:
              TYPENAME: Argument
    4:
      Publish:
        TUPLE:
          - SEQ:
              SEQ: U8
          - SEQ:
              TYPENAME: ObjectID
    5:
      MakeMoveVec:
        TUPLE:
          - OPTION:
              TYPENAME: TypeTag
          - SEQ:
              TYPENAME: Argument
    6:
      Upgrade:
        TUPLE:
          - SEQ:
              SEQ: U8
          - SEQ:
              TYPENAME: ObjectID
          - TYPENAME: ObjectID
          - TYPENAME: Argument
CommandArgumentError:
  ENUM:
    0:
      TypeMismatch: UNIT
    1:
      InvalidBCSBytes: UNIT
    2:
      InvalidUsageOfPureArg: UNIT
    3:
      InvalidArgumentToPrivateEntryFunction: UNIT
    4:
      IndexOutOfBounds:
        STRUCT:
          - idx: U16
    5:
      SecondaryIndexOutOfBounds:
        STRUCT:
          - result_idx: U16
          - secondary_idx: U16
    6:
      InvalidResultArity:
        STRUCT:
          - result_idx: U16
    7:
      InvalidGasCoinUsage: UNIT
    8:
      InvalidValueUsage: UNIT
    9:
      InvalidObjectByValue: UNIT
    10:
      InvalidObjectByMutRef: UNIT
CompressedSignature:
  ENUM:
    0:
      Ed25519:
        NEWTYPE:
          TUPLEARRAY:
            CONTENT: U8
            SIZE: 64
    1:
      Secp256k1:
        NEWTYPE:
          TUPLEARRAY:
            CONTENT: U8
            SIZE: 64
ConsensusCommitPrologue:
  STRUCT:
    - epoch: U64
    - round: U64
    - commit_timestamp_ms: U64
Data:
  ENUM:
    0:
      Move:
        NEWTYPE:
          TYPENAME: MoveObject
    1:
      Package:
        NEWTYPE:
          TYPENAME: MovePackage
DeleteKind:
  ENUM:
    0:
      Normal: UNIT
    1:
      UnwrapThenDelete: UNIT
    2:
      Wrap: UNIT
Digest:
  NEWTYPESTRUCT: BYTES
ECMHLiveObjectSetDigest:
  STRUCT:
    - digest:
        TYPENAME: Digest
EmptySignInfo:
  STRUCT: []
EndOfEpochData:
  STRUCT:
    - nextEpochCommittee:
        SEQ:
          TUPLE:
            - TYPENAME: AuthorityPublicKeyBytes
            - U64
    - nextEpochProtocolVersion:
        TYPENAME: ProtocolVersion
    - epochCommitments:
        SEQ:
          TYPENAME: CheckpointCommitment
Envelope:
  STRUCT:
    - data:
        TYPENAME: SenderSignedData
    - auth_signature:
        TYPENAME: EmptySignInfo
ExecutionData:
  STRUCT:
    - transaction:
        TYPENAME: Envelope
    - effects:
        TYPENAME: TransactionEffects
ExecutionDigests:
  STRUCT:
    - transaction:
        TYPENAME: TransactionDigest
    - effects:
        TYPENAME: TransactionEffectsDigest
ExecutionFailureStatus:
  ENUM:
    0:
      InsufficientGas: UNIT
    1:
      InvalidGasObject: UNIT
    2:
      InvariantViolation: UNIT
    3:
      FeatureNotYetSupported: UNIT
    4:
      MoveObjectTooBig:
        STRUCT:
          - object_size: U64
          - max_object_size: U64
    5:
      MovePackageTooBig:
        STRUCT:
          - object_size: U64
          - max_object_size: U64
    6:
      CircularObjectOwnership:
        STRUCT:
          - object:
              TYPENAME: ObjectID
    7:
      InsufficientCoinBalance: UNIT
    8:
      CoinBalanceOverflow: UNIT
    9:
      PublishErrorNonZeroAddress: UNIT
    10:
      SuiMoveVerificationError: UNIT
    11:
      MovePrimitiveRuntimeError:
        NEWTYPE:
          TYPENAME: MoveLocationOpt
    12:
      MoveAbort:
        TUPLE:
          - TYPENAME: MoveLocation
          - U64
    13:
      VMVerificationOrDeserializationError: UNIT
    14:
      VMInvariantViolation: UNIT
    15:
      FunctionNotFound: UNIT
    16:
      ArityMismatch: UNIT
    17:
      TypeArityMismatch: UNIT
    18:
      NonEntryFunctionInvoked: UNIT
    19:
      CommandArgumentError:
        STRUCT:
          - arg_idx: U16
          - kind:
              TYPENAME: CommandArgumentError
    20:
      TypeArgumentError:
        STRUCT:
          - argument_idx: U16
          - kind:
              TYPENAME: TypeArgumentError
    21:
      UnusedValueWithoutDrop:
        STRUCT:
          - result_idx: U16
          - secondary_idx: U16
    22:
      InvalidPublicFunctionReturnType:
        STRUCT:
          - idx: U16
    23:
      InvalidTransferObject: UNIT
    24:
      EffectsTooLarge:
        STRUCT:
          - current_size: U64
          - max_size: U64
    25:
      PublishUpgradeMissingDependency: UNIT
    26:
      PublishUpgradeDependencyDowngrade: UNIT
    27:
      PackageUpgradeError:
        STRUCT:
          - upgrade_error:
              TYPENAME: PackageUpgradeError
    28:
      WrittenObjectsTooLarge:
        STRUCT:
          - current_size: U64
          - max_size: U64
ExecutionStatus:
  ENUM:
    0:
      Success: UNIT
    1:
      Failure:
        STRUCT:
          - error:
              TYPENAME: ExecutionFailureStatus
          - command:
              OPTION: U64
FullCheckpointContents:
  STRUCT:
    - transactions:
        SEQ:
          TYPENAME: ExecutionData
    - user_signatures:
        SEQ:
          SEQ:
            TYPENAME: GenericSignature
GasCostSummary:
  STRUCT:
    - computationCost: U64
    - storageCost: U64
    - storageRebate: U64
    - nonRefundableStorageFee: U64
GasData:
  STRUCT:
    - payment:
        SEQ:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
            - TYPENAME: ObjectDigest
    - owner:
        TYPENAME: SuiAddress
    - price: U64
    - budget: U64
GenericSignature:
  NEWTYPESTRUCT:
    SEQ: U8
GenesisObject:
  ENUM:
    0:
      RawObject:
        STRUCT:
          - data:
              TYPENAME: Data
          - owner:
              TYPENAME: Owner
GenesisTransaction:
  STRUCT:
    - objects:
        SEQ:
          TYPENAME: GenesisObject
Identifier:
  NEWTYPESTRUCT: STR
Intent:
  STRUCT:
    - scope: U8
    - version: U8
    - app_id: U8
IntentMessage:
  STRUCT:
    - intent:
        TYPENAME: Intent
    - value:
        TYPENAME: TransactionData
ModuleId:
  STRUCT:
    - address:
        TYPENAME: AccountAddress
    - name:
        TYPENAME: Identifier
MoveFieldLayout:
  STRUCT:
    - name:
        TYPENAME: Identifier
    - layout:
        TYPENAME: MoveTypeLayout
MoveLocation:
  STRUCT:
    - module:
        TYPENAME: ModuleId
    - function: U16
    - instruction: U16
    - function_name:
        OPTION: STR
MoveLocationOpt:
  NEWTYPESTRUCT:
    OPTION:
      TYPENAME: MoveLocation
MoveObject:
  STRUCT:
    - type_:
        TYPENAME: MoveObjectType
    - has_public_transfer: BOOL
    - version:
        TYPENAME: SequenceNumber
    - contents: BYTES
MoveObjectType:
  NEWTYPESTRUCT:
    TYPENAME: MoveObjectType_
MoveObjectType_:
  ENUM:
    0:
      Other:
        NEWTYPE:
          TYPENAME: StructTag
    1:
      GasCoin: UNIT
    2:
      StakedSui: UNIT
    3:
      Coin:
        NEWTYPE:
          TYPENAME: TypeTag
MovePackage:
  STRUCT:
    - id:
        TYPENAME: ObjectID
    - version:
        TYPENAME: SequenceNumber
    - module_map:
        MAP:
          KEY: STR
          VALUE: BYTES
    - type_origin_table:
        SEQ:
          TYPENAME: TypeOrigin
    - linkage_table:
        MAP:
          KEY:
            TYPENAME: ObjectID
          VALUE:
            TYPENAME: UpgradeInfo
MoveStructLayout:
  ENUM:
    0:
      Runtime:
        NEWTYPE:
          SEQ:
            TYPENAME: MoveTypeLayout
    1:
      WithFields:
        NEWTYPE:
          SEQ:
            TYPENAME: MoveFieldLayout
    2:
      WithTypes:
        STRUCT:
          - type_:
              TYPENAME: StructTag
          - fields:
              SEQ:
                TYPENAME: MoveFieldLayout
MoveTypeLayout:
  ENUM:
    0:
      bool: UNIT
    1:
      u8: UNIT
    2:
      u64: UNIT
    3:
      u128: UNIT
    4:
      address: UNIT
    5:
      vector:
        NEWTYPE:
          TYPENAME: MoveTypeLayout
    6:
      struct:
        NEWTYPE:
          TYPENAME: MoveStructLayout
    7:
      signer: UNIT
    8:
      u16: UNIT
    9:
      u32: UNIT
    10:
      u256: UNIT
MultiSig:
  STRUCT:
    - sigs:
        SEQ:
          TYPENAME: CompressedSignature
    - bitmap: BYTES
    - multisig_pk:
        TYPENAME: MultiSigPublicKey
MultiSigPublicKey:
  STRUCT:
    - pk_map:
        SEQ:
          TUPLE:
            - STR
            - U8
    - threshold: U16
ObjectArg:
  ENUM:
    0:
      ImmOrOwnedObject:
        NEWTYPE:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
            - TYPENAME: ObjectDigest
    1:
      SharedObject:
        STRUCT:
          - id:
              TYPENAME: ObjectID
          - initial_shared_version:
              TYPENAME: SequenceNumber
          - mutable: BOOL
ObjectDigest:
  NEWTYPESTRUCT:
    TYPENAME: Digest
ObjectID:
  NEWTYPESTRUCT:
    TYPENAME: AccountAddress
ObjectInfoRequestKind:
  ENUM:
    0:
      LatestObjectInfo: UNIT
    1:
      PastObjectInfoDebug:
        NEWTYPE:
          TYPENAME: SequenceNumber
Owner:
  ENUM:
    0:
      AddressOwner:
        NEWTYPE:
          TYPENAME: SuiAddress
    1:
      ObjectOwner:
        NEWTYPE:
          TYPENAME: SuiAddress
    2:
      Shared:
        STRUCT:
          - initial_shared_version:
              TYPENAME: SequenceNumber
    3:
      Immutable: UNIT
PackageUpgradeError:
  ENUM:
    0:
      UnableToFetchPackage:
        STRUCT:
          - package_id:
              TYPENAME: ObjectID
    1:
      NotAPackage:
        STRUCT:
          - object_id:
              TYPENAME: ObjectID
    2:
      IncompatibleUpgrade: UNIT
    3:
      DigestDoesNotMatch:
        STRUCT:
          - digest:
              SEQ: U8
    4:
      UnknownUpgradePolicy:
        STRUCT:
          - policy: U8
    5:
      PackageIDDoesNotMatch:
        STRUCT:
          - package_id:
              TYPENAME: ObjectID
          - ticket_id:
              TYPENAME: ObjectID
ProgrammableMoveCall:
  STRUCT:
    - package:
        TYPENAME: ObjectID
    - module:
        TYPENAME: Identifier
    - function:
        TYPENAME: Identifier
    - type_arguments:
        SEQ:
          TYPENAME: TypeTag
    - arguments:
        SEQ:
          TYPENAME: Argument
ProgrammableTransaction:
  STRUCT:
    - inputs:
        SEQ:
          TYPENAME: CallArg
    - commands:
        SEQ:
          TYPENAME: Command
ProtocolVersion:
  NEWTYPESTRUCT: U64
SenderSignedData:
  NEWTYPESTRUCT:
    SEQ:
      TYPENAME: SenderSignedTransaction
SenderSignedTransaction:
  STRUCT:
    - intent_message:
        TYPENAME: IntentMessage
    - tx_signatures:
        SEQ:
          TYPENAME: GenericSignature
SequenceNumber:
  NEWTYPESTRUCT: U64
StructTag:
  STRUCT:
    - address:
        TYPENAME: AccountAddress
    - module:
        TYPENAME: Identifier
    - name:
        TYPENAME: Identifier
    - type_args:
        SEQ:
          TYPENAME: TypeTag
SuiAddress:
  NEWTYPESTRUCT:
    TUPLEARRAY:
      CONTENT: U8
      SIZE: 32
TransactionData:
  ENUM:
    0:
      V1:
        NEWTYPE:
          TYPENAME: TransactionDataV1
TransactionDataV1:
  STRUCT:
    - kind:
        TYPENAME: TransactionKind
    - sender:
        TYPENAME: SuiAddress
    - gas_data:
        TYPENAME: GasData
    - expiration:
        TYPENAME: TransactionExpiration
TransactionDigest:
  NEWTYPESTRUCT:
    TYPENAME: Digest
TransactionEffects:
  ENUM:
    0:
      V1:
        NEWTYPE:
          TYPENAME: TransactionEffectsV1
TransactionEffectsDigest:
  NEWTYPESTRUCT:
    TYPENAME: Digest
TransactionEffectsV1:
  STRUCT:
    - status:
        TYPENAME: ExecutionStatus
    - executed_epoch: U64
    - gas_used:
        TYPENAME: GasCostSummary
    - modified_at_versions:
        SEQ:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
    - shared_objects:
        SEQ:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
            - TYPENAME: ObjectDigest
    - transaction_digest:
        TYPENAME: TransactionDigest
    - created:
        SEQ:
          TUPLE:
            - TUPLE:
                - TYPENAME: ObjectID
                - TYPENAME: SequenceNumber
                - TYPENAME: ObjectDigest
            - TYPENAME: Owner
    - mutated:
        SEQ:
          TUPLE:
            - TUPLE:
                - TYPENAME: ObjectID
                - TYPENAME: SequenceNumber
                - TYPENAME: ObjectDigest
            - TYPENAME: Owner
    - unwrapped:
        SEQ:
          TUPLE:
            - TUPLE:
                - TYPENAME: ObjectID
                - TYPENAME: SequenceNumber
                - TYPENAME: ObjectDigest
            - TYPENAME: Owner
    - deleted:
        SEQ:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
            - TYPENAME: ObjectDigest
    - unwrapped_then_deleted:
        SEQ:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
            - TYPENAME: ObjectDigest
    - wrapped:
        SEQ:
          TUPLE:
            - TYPENAME: ObjectID
            - TYPENAME: SequenceNumber
            - TYPENAME: ObjectDigest
    - gas_object:
        TUPLE:
          - TUPLE:
              - TYPENAME: ObjectID
              - TYPENAME: SequenceNumber
              - TYPENAME: ObjectDigest
          - TYPENAME: Owner
    - events_digest:
        OPTION:
          TYPENAME: TransactionEventsDigest
    - dependencies:
        SEQ:
          TYPENAME: TransactionDigest
TransactionEventsDigest:
  NEWTYPESTRUCT:
    TYPENAME: Digest
TransactionExpiration:
  ENUM:
    0:
      None: UNIT
    1:
      Epoch:
        NEWTYPE: U64
TransactionKind:
  ENUM:
    0:
      ProgrammableTransaction:
        NEWTYPE:
          TYPENAME: ProgrammableTransaction
    1:
      ChangeEpoch:
        NEWTYPE:
          TYPENAME: ChangeEpoch
    2:
      Genesis:
        NEWTYPE:
          TYPENAME: GenesisTransaction
    3:
      ConsensusCommitPrologue:
        NEWTYPE:
          TYPENAME: ConsensusCommitPrologue
TypeArgumentError:
  ENUM:
    0:
      TypeNotFound: UNIT
    1:
      ConstraintNotSatisfied: UNIT
TypeOrigin:
  STRUCT:
    - module_name: STR
    - struct_name: STR
    - package:
        TYPENAME: ObjectID
TypeTag:
  ENUM:
    0:
      bool: UNIT
    1:
      u8: UNIT
    2:
      u64: UNIT
    3:
      u128: UNIT
    4:
      address: UNIT
    5:
      signer: UNIT
    6:
      vector:
        NEWTYPE:
          TYPENAME: TypeTag
    7:
      struct:
        NEWTYPE:
          TYPENAME: StructTag
    8:
      u16: UNIT
    9:
      u32: UNIT
    10:
      u256: UNIT
TypedStoreError:
  ENUM:
    0:
      RocksDBError:
        NEWTYPE: STR
    1:
      SerializationError:
        NEWTYPE: STR
    2:
      UnregisteredColumn:
        NEWTYPE: STR
    3:
      CrossDBBatch: UNIT
    4:
      MetricsReporting: UNIT
    5:
      RetryableTransactionError: UNIT
UpgradeInfo:
  STRUCT:
    - upgraded_id:
        TYPENAME: ObjectID
    - upgraded_version:
        TYPENAME: SequenceNumber

